import { Card, Container, Row, Col } from "react-bootstrap";
import { useAuthContext } from "../../hooks/useAuthContext";

/* Styling */
import "./Home.css"

export default function Home() {

    const { state } = useAuthContext()

    return (
        <div className="home">
            
            <Container fluid>
                <h1>Welcome { state.username } !</h1>
                <Col>
                    <Row><h1>1</h1></Row>
                </Col>
                <Col>
                    <Row><h1>2</h1></Row>
                    <Row><h1>3</h1></Row>
                </Col>
            </Container>

        </div>
    )
}
